package string;

import org.junit.Assert;
import org.junit.Test;

/**
 * @author : Wissen Solutions.
 */
public class SubStringImplementation {
    @Test
    public void testHealthy() {
        Assert.assertEquals(-1, strStr("babba", "bbb"));
//        Assert.assertEquals(-1, strStr("\"",
//                ""));
//        Assert.assertEquals(-1, strStr("", ""));
    }

    public int strStr(String haystack, String needle) {
        if( haystack == null ){
            return -1;
        }
        if(needle.length() > haystack.length()){
            return -1;
        }
        if((needle.length() == haystack.length()) && needle.length()== 0){
            return 0;
        }

        if(needle == null || needle.length() == 0 ){
            return 0;
        }
        char[] charArr = haystack.toCharArray();
        char[] needleArr = needle.toCharArray();
        for(int i = 0; i<charArr.length && charArr.length - i >= needleArr.length; i++){
            if(charArr[i] == needleArr[0]){
                if(areEqual(charArr, needleArr, i, i+needleArr.length-1)){
                    return i;
                }
            }
        }
        return -1;
    }
    private boolean areEqual(char[] a, char[] b, int i, int j){
        int k = b.length-1;
        int m = 0;
        while(i <= j){
            if(a[i] != b[m] || a[j] != b[k]){
                return false;
            }
            i++;
            m++;
            j--;
            k--;
        }
        return true;
    }

}
